import React from 'react';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css';
import "./Home.css";
import {img} from '';

 


 //const img1 ="https://www.dreamstime.com/photos-images/prem-mandir.html";


 
 

      
       
       
        const Home = () => {
          
          
              return (
                <>
                <div className="slide-container">
                  <Slide>
                    <div className="each-slide">
                      <div  className="image" style={{'backgroundImage': `url(${img}$)`}}>
                        <span>Slide 1</span>
                      </div>
                    </div>
                    <div className="each-slide">
                      <div className="image" style={{'backgroundImage': `url("https://www.baps.org/Data/Sites/1/Media/ModuleRotatorImages/BAPS%20Shri%20Swaminarayan%20Mandir%20-%20London%20-%20baps.jpg")`}}>
                        <span>Slide 2</span>
                      </div>
                    </div>
                    <div className="each-slide">
                      <div className="image" style={{'backgroundImage': `url("https://www.baps.org/Data/Sites/1/Media/ModuleRotatorImages/BAPS%20Shri%20Swaminarayan%20Mandir%20-%20London%20-%20baps.jpg")`}}>
                        <span>Slide 3</span>
                      </div>
                    </div>
                  </Slide>
                </div>
                
                </>


              )
          
                
        };
    export default Home;
